import React from "react";
import Slider from "./component/Homeslider";
const Home = () =>{
    return (
        <>
        <div className="home_page">
            <div className="banner">
               {Slider}
            </div>
            <div className="container"><h1>hey</h1></div>
        </div>
        </>
    )
};
export default Home;
